@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  userName = "Joaquim";
  userData = {
   email: 'joaquim@email.com',
   role: "Admin"
  };
  title = 'curso-angular';
}
